import React from 'react';

function AgeFilter() {
  const ranges = ['0–5', '6–15', '16–30', '31–45', '46–50', '61–75'];
  return (
    <section>
      <h2>Shop by Age</h2>
      <div style={{ display: 'flex', flexWrap: 'wrap' }}>
        {ranges.map((range, i) => (
          <button key={i}>{range} Years</button>
        ))}
      </div>
    </section>
  );
}

export default AgeFilter;
